mixed-port: 7890
# 所有节点均从公开互联网上抓取，使用clash自动检查可用性即可
# 抓取程序已开源： https://github.com/zu1k/proxypool
# (HTTP and SOCKS5 in one port)
# mixed-port: 7890
# redir port for Linux and macOS
# redir-port: 7892
allow-lan: false
mode: rule
log-level: info
external-controller: 127.0.0.1:51292

proxies: null

proxy-groups:
  - name: 全局选择
    type: select
    proxies:
      - 延迟最低
      - 选择国家或地区
      # - 选择节点
      - 失败切换
      - 负载均衡
  - name: 选择国家或地区
    type: select
    proxies:
      - 🇨🇳 中国
      - 🇯🇵 日本
      - 🇸🇬 新加坡
      # - 🇺🇸 美国
      - 🇭🇰 香港
      # - 🇨🇳 台湾
      - 🇨🇦 加拿大
      # - 🇷🇺 俄罗斯
      - 🇦🇺 澳大利亚
      # - 🇨🇭 瑞士
      # - 🇩🇪 德国
      # - 🇫🇷 法国
      # - 🇬🇧 英国
      # - 🇳🇱 荷兰
      # - 其他国家
  # - name: 选择节点
  #   type: select
  #   use:
  #     - all
  - name: 🇨🇳 中国
    type: select
    use:
      - cn
  - name: 🇭🇰 香港
    type: select
    use:
      - hk
  # - name: 🇨🇳 台湾
  #   type: select
  #   interval: 300
  #   use:
  #     - tw
  - name: 🇯🇵 日本
    type: select
    use:
      - jp
  - name: 🇸🇬 新加坡
    type: select
    use:
      - sg
  # - name: 🇺🇸 美国
  #   type: select
  #   use:
  #     - us
  - name: 🇨🇦 加拿大
    type: select
    use:
      - ca
  # - name: 🇷🇺 俄罗斯
  #   type: select
  #   use:
  #     - ru
  - name: 🇦🇺 澳大利亚
    type: select
    use:
      - au
  # - name: 🇨🇭 瑞士
  #   type: select
  #   use:
  #     - ch
  # - name: 🇩🇪 德国
  #   type: select
  #   use:
  #     - de
  # - name: 🇫🇷 法国
  #   type: select
  #   use:
  #     - fr
  # - name: 🇬🇧 英国
  #   type: select
  #   use:
  #     - gb
  # - name: 🇳🇱 荷兰
  #   type: select
  #   use:
  #     - nl
  # - name: 其他国家
  #   type: select
  #   use:
  #     - others
  - name: 延迟最低
    type: url-test
    use:
      - all
    url: 'https://www.youtube.com'
    interval: 300
  - name: 负载均衡
    type: load-balance
    use:
      - all
    url: 'https://www.youtube.com'
    interval: 300
  - name: 失败切换
    type: fallback
    use:
      - all
    url: 'https://www.youtube.com'
    interval: 300

